  true,\n\t\"url\": null,\n\t\"notes\": \"The collection-3 Chlorine Dioxide Product
  OMOCLO from the Aura-OMI, is now available (http://disc.gsfc.nasa.gov/Aura/OMI/omoclo_v003.shtml)
  from the NASA Goddard Earth Sciences Data and Information Services Center (GES DISC)
  for the public access.nn(The shortname for this Level-2 OMI total column OClO product
  is OMOCLO)nThe algorithm leads for this product are the US OMI scientists Dr. Kelly
  Chance (kchance@cfa.harvard.edu) and Dr. Thomas Kurosu (tkurosu@cfa.harvard.edu)
  from the Harvard-Smithsonian Center, Cambridge, MA.n       nThe OMOCLO product contains
  slant column OClO, standard erros (rms  and sigma), quality flags, geolocation and
  other ancillary information.       n nOMOCLO files are stored in EOS Hierarchical
  Data Format  (HDF-EOS5). Each file contains data from the day lit portion of an
  \ orbit (~53 minutes). There are approximately 14 orbits per day. The  maximum file
  size for the OMOCLO data product is about 20 Mbytes.n       nA short OMOCLO Readme
  Document that includes brief algorithmndescription and documents that provides known
  data quality relatednissues are available from the Harvard-Smithsonian Center site:n
  nhttp://www.cfa.harvard.edu/~tkurosu/SatelliteInstruments/OMI/PGEReleases/\",\n\t\"license_title\":
